import React from 'react';
import logo from './img/logo.png';



const Header = () => {

	return(
			<>
			<div className="Header">
				<img src={logo} alt="Logo" title="Mukesh Keep" />
				<h1>Mukesh Keep</h1>
			</div>
			</>
		);
};

export default Header;
